import React, { Component } from 'react';
import {Row, Col, Breadcrumb, CardHeader, CardBody} from 'reactstrap';
import {Route} from 'react-router-dom';
import Breadcrumbs from './Breadcrumbs';
import Header from './Header';
import ProductList from './ProductList';
import Product from './Product';
import Footer from './Footer'

class Canvan extends Component{
	constructor(props) {
		super(props);
		this.state = {}
    }

    componentDidMount(){
        console.log(this.props);
    }

	render(){

        const pos = {pag:"12", center:{size: 10, offset: 1}}
		return(
            <Row>
                <Col xs={pos.pag} sm={pos.pag} md={pos.pag}>
                    <CardHeader>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Header/>
                        </Col>
                    </CardHeader>
                    <Breadcrumb>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Breadcrumbs/>
                        </Col>
                    </Breadcrumb>
                    <CardBody>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Route path="/" component={ProductList} exact/>
                            <Route path="/items" component={Product} exact/>
                            <Route path="/items/:id" component={Product} exact/>
                        </Col>
                    </CardBody>
                    <CardBody>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Footer/>
                        </Col>
                    </CardBody>
                </Col>
            </Row>
		)	
	}
}

export default Canvan;
